import React from 'react'
import '../index.css';
import DataTable from "react-data-table-component";

const Dashboard = () => {

        const columns = [
                {
                        name: 'Nome',
                        selector: row => row.title,
                },
                {
                        name: 'Data devolução',
                        selector: row => row.year,
                },
        ];

        const data = [
                {
                        id: 1,
                        title: 'Rhyan',
                        year: '1988/08/2020',
                },
                {
                        id: 2,
                        title: 'Ghostbusters',
                        year: '1988/08/2020',
                },
        ]
        return (
                <div className="sec__one">
                       <div className='container_midless'>
                        <h1 className='align_center'>Atrasados</h1>
                       <DataTable
                                columns={columns}
                                data={data}
                        />
                       </div>
                </div>
        )
}
export default Dashboard
